import firebase from 'firebase/compat/app';
import 'firebase/compat/firestore';

const firebaseConfig = {
    apiKey: "AIzaSyAV4Z1oMKFYD3YU8FUtPeN6cU8W1qHRmhs",
    authDomain: "app-noticia-d2d73.firebaseapp.com",
    projectId: "app-noticia-d2d73",
    storageBucket: "app-noticia-d2d73.appspot.com",
    messagingSenderId: "1017096988583",
    appId: "1:1017096988583:web:0bd125e97d1420d8cc3882"
};

let app;

if (firebase.apps.length === 0) {
  app = firebase.initializeApp(firebaseConfig)
} else {
  app = firebase.app();
}

const db = app.firestore();

export { db };
